//go:build cgo && ((linux && amd64) || (darwin && amd64) || (darwin && arm64) || (windows && amd64)) && sphincs_sha2_256s

package tests

import (
	"encoding/hex"
	"testing"

	"github.com/stretchr/testify/require"
  sphincsplus "github.com/ioerror/sphincsplus/ref"
)

func TestSignVerifyVectorSpecifics(t *testing.T) {

	privKey := new(sphincsplus.PrivateKey)
	privKeyBytes, err := hex.DecodeString("11e32155ed90a5665b3a34eb5e45b85b980f874539c701430d21787a56a543f6fa27de5668cdd86dcc570e3a5f14cc92200cc2e6ccc104115892bee2c79d0531f5dffa8a6c09c4516dd21cb4d6ea8596bc2ed6fca7aed573da78b8e3b3a3907d0a13486d30b773c4a57565e3183c1243bff4f7ab136329127b8b3e1e5492f024")
	require.NoError(t, err)
	err = privKey.FromBytes(privKeyBytes)
	require.NoError(t, err)

	pubKey := new(sphincsplus.PublicKey)
	pubKeyBytes, err := hex.DecodeString("f5dffa8a6c09c4516dd21cb4d6ea8596bc2ed6fca7aed573da78b8e3b3a3907d0a13486d30b773c4a57565e3183c1243bff4f7ab136329127b8b3e1e5492f024")
	require.NoError(t, err)
	err = pubKey.FromBytes(pubKeyBytes)

  signature, err := hex.DecodeString("")
	require.NoError(t, err)

	t.Logf("SPHINCS+ scheme parameters: %s", sphincsplus.SchemeName())
	t.Logf("priv key %x", privKey.Bytes())
	t.Logf("pub key %x", pubKey.Bytes())
	t.Logf("sig %x", signature)
	message := []byte("i am a message")
	require.True(t, pubKey.Verify(signature, message))

}
